inline:
div, a, button {
  border-radius: 0px !important;
}

.fern-card.interactive {
  border: 2px solid rgb(0, 0, 0);
}

:is(.dark) .fern-card.interactive {
  border: 2px solid white;
}

.fern-card.interactive:hover {
  box-shadow: rgb(0, 0, 0) 8px 8px 0px -2px, rgb(0, 0, 0) 8px 8px 0px;
}

:is(.dark) .fern-card.interactive:hover {
  box-shadow: white 8px 8px 0px -2px, white 8px 8px 0px;
}

.fern-button:not(.disabled).filled.primary {
  color: white !important;
  --tw-ring-color: #3b2fc9 !important;
  background: #3b2fc9 !important;
  border: 2px solid rgb(59, 47, 201);
  transition: transform 150ms linear 0s, background-color 150ms linear 0s, box-shadow 150ms linear 0s, border-color 150ms linear 0s !important;
}

.fern-button:not(.disabled).filled.primary:hover {
  background-color: rgb(93, 83, 215);
  box-shadow: rgb(47, 38, 161) 2px 2px;
  border-color: rgb(47, 38, 161);

}

.fern-button-text {
  font-weight: 500 !important;
}

.fern-button:not(.disabled).filled.primary .fa-icon {
  background-color: white !important;
}

.fern-button:not(.disabled).filled.primary svg {
  color: white !important;
}

.fern-header-searchbar {
  max-width: 500px !important;
}

.fern-search-bar {
  border: 2px solid rgb(0, 0, 0) !important;
  background-color: rgb(255, 255, 255) !important;
  box-shadow: unset !important;
  text-shadow: unset !important;
}

.fern-search-bar .search-placeholder span {
  color: #000 !important;
}

.fern-search-bar .search-placeholder svg {
  color: #000 !important;
}

