import datetime

from flatfile import GuestConfig, GuestSpace, GuestWorkbook
from flatfile.client import AsyncFlatfile

client = AsyncFlatfile(
    token="YOUR_TOKEN",
)
await client.guests.create(
    request=[
        GuestConfig(
            environment_id="us_env_YOUR_ID",
            email="email@example.com",
            name="Your Name",
            spaces=[
